import "./App.css";
import Gallery from "./components/Gallery";

function App() {
  const darkTheme = createMuiTheme({
    palette: {
      type: "dark",
    },
  });

  return (
    <div className="App" style={darkTheme}>
      <Gallery />
    </div>
  );
}

export default App;
